import style from "./message.style.module.css";

export default function Message() {
  return (
    <div className={style.container}>
        Meu amor, como eu gostaria de ver seu sorriso de pertinho quando eu te desse parabéns 4neste seu dia especial, eu quero lhe desejar um feliz aniversário! E como eu queria poder celebrar ao seu lado, como eu queria fazer essa distância que nos separa desaparecer, pois tantas são as saudades que eu sinto de você.

Parabéns, meu amor! Um dia muito feliz! No sonho eu alimento o desejo que até você cheguem, não apenas esta mensagem, mas todo o meu amor, as saudades e os beijos que guardo ansiosos para você.
    </div>
  );
}
